import styled from 'styled-components/native';

export const Background = styled.View`
    flex: 1;
    background-image: linear-gradient(140deg, #FFAB09 0%, #FFD024 0.01%, #B312B3 100%);
    

    display: flex;
    flex-flow: row nowrap;
    justify-content: center;
    align-items: center;

    /*
    background-image: linear-gradient(167.96deg, #FFAB09 0%, #FFD024 0.01%, #B312B3 100%);
    */
    background: linear-gradient(167.96deg, #FFAB09 0%, #FFD024 0.01%, #B312B3 100%);
    linear-gradient(0deg, #FFFFFF, #FFFFFF);
    

`;
